"This XRC sounds really cool, but how do I actually use it?" Using XRC is very straightforward. First, you need to know XRC's ID, which is uf6dk-hyaaa-aaaaq-qaaaq-cai. Then you can send it a request containing a base asset, a quote asset, and an optional timestamp. Copy codetype GetExchangeRateRequest = record { base_asset: Asset; quote_asset: Asset; timestamp: opt nat64;
}; After sending your request, XRC will reply with a result - either a successful exchange rate or an error message. Copy codetype GetExchangeRateResult = variant { Ok: ExchangeRate; Err: ExchangeRateError;
}; Note your request must contain sufficient Cycles, otherwise XRC will return an error. In fact, the cost per call depends on the asset types requested and XRC's internal rate cache state.

