Let's carefully analyze the code of the Connectd Canister: ‚îú‚îÄ‚îÄ connectd
‚îÇ ‚îú‚îÄ‚îÄ digraph.mo
‚îÇ ‚îú‚îÄ‚îÄ main.mo
‚îÇ ‚îî‚îÄ‚îÄ types.mo Under the Connectd Canister, there are three Motoko files: main.mo is the main code file of the Connectd Canister, defining an actor. types.mo is the module file containing custom type definitions, imported and used in main.mo. digraph.mo is a module file defining a public class that main.mo can instantiate and use its API to handle relationship data. Now, let's delve into the code line by line. In types.mo, some custom types are defined: import Principal "mo:base/Principal"; module { public type Vertex = Principal;
}; digraph.mo is a module file that implements a simple directed graph data structure, providing basic functionalities such as adding vertices, adding edges, and querying adjacent vertices. This implementation allows easy construction and manipulation of a directed graph. The code defines a class for a "User Relationship Graph" (Digraph) to represent relationships between users. This graph is a directed graph where users are considered vertices, and relationships between users are considered directed edges. import Array "mo:base/Array";
import Iter "mo:base/Iter";
import Types "./types"; module { type Vertex = Types.Vertex; public class Digraph() { var vertexList: [Vertex] = []; var edgeList: [(Vertex, Vertex)] = []; public func addVertex(vertex: Vertex) { vertexList := Array.append<Vertex>(vertexList, [vertex]); }; public func addEdge(fromVertex: Vertex, toVertex: Vertex) { edgeList := Array.append<(Vertex, Vertex)>(edgeList, [(fromVertex, toVertex)]); }; public func getAdjacent(vertex: Vertex): [Vertex] { var adjacencyList: [Vertex] = []; for ((fromVertex, toVertex) in Iter.fromArray<(Vertex, Vertex)>(edgeList)) { if (fromVertex == vertex) { adjacencyList := Array.append<Vertex>(adjacencyList, [toVertex]); }; }; adjacencyList }; };
}; main.mo manages the connections between users. It defines APIs that can be called externally, and the graph-related operations are performed by instantiating the graph class. This helps organize and query relationships between users, suitable for scenarios such as social networks and relationship graphs. import Digraph "./digraph";
import Types "./types"; actor Connectd { type Vertex = Types.Vertex; var graph: Digraph.Digraph = Digraph.Digraph(); public func healthcheck(): async Bool { true }; public func connect(userA: Vertex, userB: Vertex): async () { graph.addEdge(userA, userB); }; public func getConnections(user: Vertex): async [Vertex] { graph.getAdjacent(user) };
};

