Now, let's create the digraph.mo file and define a class Digraph to represent the follow relationships between users. Write down the types defined earlier: module { type Vertex = Types.Vertex;
}Ôºõ vertexList stores all the vertices, and edgeList stores all the directed edges, representing the follow relationships: type Vertex = Types.Vertex; public class Digraph() { var vertexList: [Vertex] = []; // Vertices var edgeList: [(Vertex, Vertex)] = []; // Directed edges
}Ôºõ addVertex is used to add vertices (users), and addEdge is used to add edges (follow relationships), using assert to ensure the uniqueness of edges: type Vertex = Types.Vertex; public class Digraph() { var vertexList: [Vertex] = []; // Vertices var edgeList: [(Vertex, Vertex)] = []; // Directed edges // The public keyword indicates that this function is accessible to anyone // If private, it can only be called by code within the Canister, not publicly accessible public func addVertex(vertex: Vertex) { vertexList := Array.append<Vertex>(vertexList, [vertex]); }; // Add a directed edge from fromVertex to toVertex public func addEdge(fromVertex: Vertex, toVertex: Vertex) { // Check if it already exists assert(Array.find<(Vertex, Vertex)>(edgeList, func((x, y): (Vertex, Vertex)): Bool { x == fromVertex and y == toVertex }) == null); edgeList := Array.append<(Vertex, Vertex)>(edgeList, [(fromVertex, toVertex)]); }; }Ôºõ getForwardAdjacent and getReverseAdjacent are used to get forward and reverse adjacent vertices, representing the user's following list and followers list, implemented by iterating through the edge list: import Array "mo:base/Array";
import Iter "mo:base/Iter";
import Types "./types"; module { type Vertex = Types.Vertex; public class Digraph() { var vertexList: [Vertex] = []; // Vertices var edgeList: [(Vertex, Vertex)] = []; // Directed edges public func addVertex(vertex: Vertex) { vertexList := Array.append<Vertex>(vertexList, [vertex]); }; // Add a directed edge from fromVertex to toVertex public func addEdge(fromVertex: Vertex, toVertex: Vertex) { // Check if it already exists assert(Array.find<(Vertex, Vertex)>(edgeList, func((x, y): (Vertex, Vertex)): Bool { x == fromVertex and y == toVertex }) == null); edgeList := Array.append<(Vertex, Vertex)>(edgeList, [(fromVertex, toVertex)]); }; // Get vertices adjacent to the forward edge, i.e., get someone's following list public func getForwardAdjacent(vertex: Vertex): [Vertex] { var adjacencyList: [Vertex] = []; for ((fromVertex, toVertex) in Iter.fromArray<(Vertex, Vertex)>(edgeList)) { if (fromVertex == vertex) { adjacencyList := Array.append<Vertex>(adjacencyList, [toVertex]); }; }; adjacencyList }; // Get vertices adjacent to the reverse edge, i.e., get someone's followers list public func getReverseAdjacent(vertex: Vertex): [Vertex] { var adjacencyList: [Vertex] = []; for ((fromVertex, toVertex) in Iter.fromArray<(Vertex, Vertex)>(edgeList)) { if (toVertex == vertex) { adjacencyList := Array.append<Vertex>(adjacencyList, [fromVertex]); }; }; adjacencyList }; }; }; Now, with the directed graph storing user relationships, we also need a place to store user profiles.

