Let's create another file specifically for storing user profiles: database.mo. Define a storage class Directory for user information, using HashMap to store user IDs and their corresponding profiles: public class Directory() { let hashMap = HashMap.HashMap<UserId, Profile>(1, isEq, Principal.hash);
}; A hash table, also known as a hash map, is a data structure that allows direct access to data based on key values. A hash table calculates a function (known as a hash function) for a key value, mapping the queried data to a position for access, thus speeding up the search for a specific key value. The working principle of a hash table can be explained with an intuitive example: Suppose there is a dictionary with a large amount of information about Chinese characters. To quickly find a specific character, a table is created initially arranged alphabetically by the pinyin letters of each character (similar to the "Pinyin Check Character Table" at the beginning of the dictionary). This establishes a kind of functional relationship between each character and its pinyin letters. When searching for a character, it is only necessary to locate the first letter, the second letter, the third letter, and so on, in this table. Most of the time, it's even possible to determine the accurate position of the character in the dictionary without searching through every letter of its pinyin. In this example, "finding the nth letter of the pinyin" is analogous to the hash function's rule, and the "Pinyin Check Character Table" can be understood as a kind of hash table. There are also some functions to implement the functionalities of creating user profiles, updating user profiles, retrieving individual user profiles, retrieving multiple user profiles, and searching for users based on keywords. The createOne and updateOne functions are used to create and update user profiles by calling the put function to add user IDs and profiles to the HashMap. public class Directory() { let hashMap = HashMap.HashMap<UserId, Profile>(1, isEq, Principal.hash); public func createOne(userId: UserId, profile: NewProfile) { hashMap.put(userId, makeProfile(userId, profile)); }; public func updateOne(userId: UserId, profile: NewProfile) { hashMap.put(userId, makeProfile(userId, profile)); }; // Other functions...
} The findOne function is used to retrieve an individual user profile by calling the get function from the HashMap. public func findOne(userId: UserId): ?Profile { hashMap.get(userId)
}; The findMany function is used to retrieve multiple user profiles by iterating through the list of user IDs and calling the getProfile function. public func findMany(userIds: [UserId]): [Profile] { func getProfile(userId: UserId): Profile { Option.unwrap<Profile>(hashMap.get(userId)) }; Array.map<UserId, Profile>(userIds, getProfile)
}; The findBy function is used to search for users based on keywords, iterating through the user profiles in the HashMap and finding matching profiles. public func findBy(term: Text): [Profile] { var profiles: [Profile] = []; for ((id, profile) in hashMap.entries()) { if (includesText(profile.name, term)) { profiles := Array.append<Profile>(profiles, [profile]); }; }; profiles
}; The auxiliary function makeProfile is used to create an instance of a user profile, and includesText is used to determine if one string contains another. func makeProfile(userId: UserId, profile: NewProfile): Profile { { id = userId; name = profile.name; biography = profile.biography; company = profile.company; education = profile.education; imgUrl = profile.imgUrl; feedCanister = profile.feedCanister; }
}; func includesText(string: Text, term: Text): Bool { let stringArray = Iter.toArray<Char>(string.chars()); let termArray = Iter.toArray<Char>(term.chars()); var i = 0; var j = 0; while (i < stringArray.size() and j < termArray.size()) { if (stringArray[i] == termArray[j]) { i += 1; j += 1; if (j == termArray.size()) { return true; } } else { i += 1; j := 0; } }; false
}; database.mo: import Array "mo:base/Array";
import Hash "mo:base/Hash";
import HashMap "mo:base/HashMap";
import Iter "mo:base/Iter";
import Nat "mo:base/Nat";
import Option "mo:base/Option";
import Principal "mo:base/Principal";
import Time "mo:base/Time";
import Types "./types";
import TrieMap "mo:base/TrieMap";
import TrieSet "mo:base/TrieSet"; module { type NewProfile = Types.NewProfile; type Profile = Types.Profile; type UserId = Types.UserId; type Time = Time.Time; public class Directory() { let hashMap = HashMap.HashMap<UserId, Profile>(1, isEq, Principal.hash); public func createOne(userId: UserId, profile: NewProfile) { hashMap.put(userId, makeProfile(userId, profile)); }; public func updateOne(userId: UserId, profile: NewProfile) { hashMap.put(userId, makeProfile(userId, profile)); }; public func findOne(userId: UserId): ?Profile { hashMap.get(userId) }; public func findMany(userIds: [UserId]): [Profile] { func getProfile(userId: UserId): Profile { Option.unwrap<Profile>(hashMap.get(userId)) }; Array.map<UserId, Profile>(userIds, getProfile) }; public func findBy(term: Text): [Profile] { var profiles: [Profile] = []; for ((id, profile) in hashMap.entries()) { if (includesText(profile.name, term)) { profiles := Array.append<Profile>(profiles, [profile]); }; }; profiles }; // Helpers func makeProfile(userId: UserId, profile: NewProfile): Profile { { id = userId; name = profile.name; biography = profile.biography; company = profile.company; education = profile.education; imgUrl = profile.imgUrl; feedCanister = profile.feedCanister; } }; func includesText(string: Text, term: Text): Bool { let stringArray = Iter.toArray<Char>(string.chars()); let termArray = Iter.toArray<Char>(term.chars()); var i = 0; var j = 0; while (i < stringArray.size() and j < termArray.size()) { if (stringArray[i] == termArray[j]) { i += 1; j += 1; if (j == termArray.size()) { return true; } } else { i += 1; j := 0; } }; false }; }; func isEq(x: UserId, y: UserId): Bool { x == y };
};

