After completing types.mo, digraph.mo, and database.mo, the final step is to integrate the aforementioned modules using the actor and implement all functionalities. The Digraph class implements a directed graph data structure for storing relationships between users. The Database class implements a database for user profiles. Now, we use the User actor class to implement the main functionalities of the user module. The User class represents a user in the social network, including functions such as following other users, retrieving the list of followers, obtaining the list of followers, creating and updating user profiles, and searching for users. Relationships between modules: The User actor relies on the Digraph and Database classes to implement the underlying data structures. In Motoko, an actor is a special type that can be thought of as a small machine or service capable of executing code. Each actor has a unique Principal ID, and it can be considered an entry point for a microservice in a service-oriented architecture. actor class Feed(...) = this { ... } Here, we see an actor class, which is a special form of an actor that can accept parameters to create new actor instances. This is similar to classes in object-oriented programming. According to the previous design, the functionalities we want to implement are summarized as follows: Allow one user to follow another user, updating the directed graph's edges and notifying the followed user's Feed Canister to update the followers' list. Query the following list and followers list of a specific user through the directed graph. Add and update a user's profile. Query user profiles. Here is the English translation: We create a rootFeedCanister to record the Root Feed Canister. The init function is used to initialize the user's root Feed Canister. The getRootFeedCanister function is used to retrieve the user's root Feed Canister. // Define UserActor
actor class User() = this { // Use a variable to represent the Root Feed Canister (used to store user feed data) // Principal.fromText is used here, so import the module above: import Principal stable var rootFeedCanister = Principal.fromText("2vxsx-fae"); // Initialization function, set Root Feed Canister public shared({caller}) func init(_rootFeedCanister: Principal) { rootFeedCanister := _rootFeedCanister; }; // Query Root Feed Canister // The query keyword indicates a query function, used to query data // The response is very fast, does not go through consensus, and does not change the Canister state public query func getRootFeedCanister(): async Principal { rootFeedCanister };
} Public, private, and shared functions: Functions in Motoko can be public (public), private (private), similar to access control in other programming languages. shared functions are a special type of public function that can communicate between different actors. public shared({caller}) func init(...) { ... } This function can be called by an external actor, and {caller} is a pattern match used to obtain the identity of the caller. The follow function is used for a user to follow another user, involving updating the follower's Feed Canister and updating the directed graph. // Function for a user to follow another user
public shared({caller}) func follow(user: Vertex): async () { // Check if Root Feed Canister is anonymous assert(not Principal.isAnonymous(rootFeedCanister)); // Create a RootFeedActor instance based on Root Feed Canister let rootFeedActor: RootFeedActor = actor(Principal.toText(rootFeedCanister)); // Iterate through all user Feed Canisters in Root Feed Actor for((_, _feedCanister) in (await rootFeedActor.getAllUserFeedCanister()).vals()) { // Create a FeedActor instance based on Feed Canister let feedActor: FeedActor = actor(Principal.toText(_feedCanister)); // Ignore the return value when calling followers, the list of followers is in the Feed Canister ignore feedActor.updateFollowers(Array.append( graph.getReverseAdjacent(user), [caller] )); }; // Add an edge in the graph, indicating that the user is following another user graph.addEdge(caller, user);
}; The shared keyword is used to declare a function or type as shared. This means that they can be shared and used between different actors. If you declare a public shared function in one actor, this function can be called by other actors and modify their state through asynchronous message passing. public shared func oneway() { }; is an example of a function with no return type that can modify the actor's state and returns () regardless of success. Motoko also defines a series of shared types. Only shared types can be used as parameters and return values for public shared functions. These shared types include all primitive types (except the Error type), the Option type, tuple types, immutable array types, object types, etc. For example, Nat and Text are shared types. The getFollowingList and getFollowersList functions retrieve the user's following list and followers list. The createProfile and updateProfile functions create and update user profiles. The getProfile function retrieves the user's profile. The searchProfile function searches for users based on keywords. Overall, this is how it looks: The complete main.mo file is as follows: import Array "mo:base/Array";
import Digraph "./digraph";
import Database "./database";
import Principal "mo:base/Principal";
import Types "./types"; // Define UserActor
actor class User() = this { // Use a variable to represent the Root Feed Canister (used to store user feed data) // Principal.fromText is used here, so import the module above: import Principal stable var rootFeedCanister = Principal.fromText("2vxsx-fae"); // Initialization function, set Root Feed Canister public shared({caller}) func init(_rootFeedCanister: Principal) { rootFeedCanister := _rootFeedCanister; }; // Query Root Feed Canister // The query keyword indicates a query function, used to query data // The response is very fast, does not go through consensus, and does not change the Canister state public query func getRootFeedCanister(): async Principal { rootFeedCanister }; // ==================== Follow Info ==================== // Define type aliases type Vertex = Types.Vertex; type RootFeedActor = Types.RootFeedActor; type FeedActor = Types.FeedActor; // Create a directed graph instance var graph: Digraph.Digraph = Digraph.Digraph(); // Function for a user to follow another user public shared({caller}) func follow(user: Vertex): async () { // Check if Root Feed Canister is anonymous assert(not Principal.isAnonymous(rootFeedCanister)); // Create a RootFeedActor instance based on Root Feed Canister let rootFeedActor: RootFeedActor = actor(Principal.toText(rootFeedCanister)); // Iterate through all user Feed Canisters in Root Feed Actor for((_, _feedCanister) in (await rootFeedActor.getAllUserFeedCanister()).vals()) { // Create a FeedActor instance based on Feed Canister let feedActor: FeedActor = actor(Principal.toText(_feedCanister)); // Ignore the return value when calling followers, the list of followers is in the Feed Canister ignore feedActor.updateFollowers(Array.append( graph.getReverseAdjacent(user), [caller] )); }; // Add an edge in the graph, indicating that the user is following another user graph.addEdge(caller, user); }; // Get the user's following list public query({caller}) func getFollowingList(user: Vertex): async [Vertex] { graph.getForwardAdjacent(user) }; // Get the followers list public query({caller}) func getFollowersList(user: Vertex): async [Vertex] { graph.getReverseAdjacent(user) }; // ==================== Profiles ==================== // Define type aliases type NewProfile = Types.NewProfile; type Profile = Types.Profile; type UserId = Types.UserId; // Create a database instance to store user profiles var directory: Database.Directory = Database.Directory(); // Create a user profile public shared({caller}) func createProfile(profile: NewProfile): async () { directory.createOne(caller, profile); }; // Update a user's profile public shared({caller}) func updateProfile(profile: NewProfile): async () { directory.updateOne(caller, profile); }; // Get a user's profile based on user ID public query func getProfile(userId: UserId): async ?Profile { directory.findOne(userId) }; // Search for user profiles based on a search term public query func searchProfile(term: Text): async [Profile] { directory.findBy(term) }; } Now, the User module is complete with basic social network functionalities. It maintains relationships between users using a directed graph, stores and queries user profiles using a database, and updates user activities through the Root Feed Canister. Next, we'll move on to building the Post module .

