Take a look at the Root Post Canister. Root Post needs to manage Buckets, and we can use a TrieMap to record three different states of Buckets: buckets stores all created Buckets, availableBuckets stores available Buckets, and unavailableBuckets stores Buckets that are already full. Since 5 Canisters need to be created after deploying the Canister, we also need an initialization function and later functions to add new Buckets. When creating a Bucket, we also need to tell the Bucket the Canister ID of the Comment Fetch and Like Fetch in the system. Therefore, in Root Post, we need to record and save Comment Fetch and Like Fetch. Finally, there are functions to query all Buckets, query available Buckets, and query full Buckets. First, define some stable variables and mappings to save Buckets. In Motoko, the stable keyword is used to define stable variables. The values of these variables should persist during the Canister upgrade process. This is a unique feature of Motoko, using the stable memory of the Internet Computer Protocol (ICP) to maintain data persistence during Canister upgrades. Stable memory can accommodate up to 400 GiB of data, regardless of the language used, whether it's Motoko, Rust, or any other language. Stable memory is a feature that allows IC to store data for an extended period. With the definition of these stable variables and mappings, the state, total number, and other information of multiple Buckets can be persistently stored. They can continue to be used after Canister upgrades, achieving persistent management of Buckets. stable let T_CYCLES = 1_000_000_000_000; // Predefine 1T Cycles for later use
stable let BUCKET_MAX_POST_NUMBER: Nat = 5000; // Record the maximum number of posts each Bucket can store
stable var bucketIndex: Nat = 0; // Record the number of Buckets already created // Define an array to save information about all created Buckets
stable var bucketsEntries: [(Nat, Principal)] = [];
// buckets is a map created based on bucketsEntries, where the key is the index, and the value is the principal of the Bucket
let buckets = TrieMap.fromEntries<Nat, Principal>(bucketsEntries.vals(), Nat.equal, Hash.hash); // availableBucketsEntries and availableBuckets are used to record currently available Buckets
stable var availableBucketsEntries: [(Nat, Principal)] = [];
let availableBuckets = TrieMap.fromEntries<Nat, Principal>(availableBucketsEntries.vals(), Nat.equal, Hash.hash); // unavailableBucketsEntries and unavailableBuckets are used to record currently unavailable Buckets
stable var unavailableBucketsEntries: [(Nat, Principal)] = [];
let unavailableBuckets = TrieMap.fromEntries<Nat, Principal>(unavailableBucketsEntries.vals(), Nat.equal, Hash.hash); The _createBucket() function creates a Canister: Using the Bucket function of the Bucket.Bucket object, it creates a new Bucket actor, passing the principal (ID) of the Root Post Canister, commentFetchCanister, and likeFetchCanister as parameters. // Logic to create a Bucket
private func _createBucket(): async Principal { // Add 4T Cycles to each Bucket Cycles.add(4 * T_CYCLES); let newBucket = await Bucket.Bucket( Principal.fromActor(this), commentFetchCanister, likeFetchCanister ); // Save the principal of the newly created Bucket to the 'buckets' mapping, with the key as the current 'bucketIndex' buckets.put(bucketIndex, Principal.fromActor(newBucket)); // Also save it to the 'availableBuckets' mapping, indicating that this Bucket is currently available availableBuckets.put(bucketIndex, Principal.fromActor(newBucket)); // Increment 'bucketIndex' by 1, indicating an increase in the number of created Buckets bucketIndex += 1; // Return the principal of the newly created Bucket Principal.fromActor(newBucket)
}; This way, the _createBucket() function can create a new Bucket actor and save its principal to two mapping tables, indicating the created and available states. It encapsulates the specific logic for creating a Bucket and is called by the createBucket() public function. It uses bucketIndex to identify each Bucket and increments this index after creation. It provides an easy way to create Buckets in batches, specifying their states and facilitating the management of multiple Buckets. Next, continue building functions to create and manage multiple Buckets. // Start by creating 5 Buckets and adding them to the 'buckets' and 'availableBuckets' mapping tables
public shared({caller}) func init(): async { var i = 0; label l loop { if(i >= 5) break l; Cycles.add(4 * T_CYCLES); let newBucket = await Bucket.Bucket( Principal.fromActor(this), commentFetchCanister, likeFetchCanister ); buckets.put(bucketIndex, Principal.fromActor(newBucket)); availableBuckets.put(bucketIndex, Principal.fromActor(newBucket)); bucketIndex += 1; i += 1; };
}; // Add previously created Buckets in bulk to 'buckets' and 'availableBuckets'
public shared({caller}) func addAvailBucket(bucketArray: [Principal]): async () { for(_bucket in bucketArray.vals()) { buckets.put(bucketIndex, _bucket); availableBuckets.put(bucketIndex, _bucket); bucketIndex += 1; };
}; // Return the current number of created Buckets
public query func getBucketIndex(): async Nat { bucketIndex }; // Public function to create a Bucket, internally calls _createBucket()
public shared({caller}) func createBucket(): async Principal { await _createBucket()
}; Now our Canister can manage the creation and addition of Buckets. The creation and lifecycle of all Buckets can be centrally managed. Later, we need to write query functions: // Query available Buckets
public query func getAvailableBucket(): async ?Principal { if(availableBuckets.size() == 0) return null; availableBuckets.get(Nat.rem(Option.unwrap(Nat.fromText(Int.toText(Time.now()))), availableBuckets.size()))
}; // Query all Buckets
public query func getAllBuckets(): async [Principal] { Iter.toArray(buckets.vals())
}; // Query all available Buckets
public query func getAllAvailableBuckets(): async [Principal] { Iter.toArray(availableBuckets.vals())
}; // Query all Buckets that are already full
public query func getAllUnavailableBuckets(): async [Principal] { Iter.toArray(unavailableBuckets.vals())
}; When creating a Bucket, we also need to tell the Bucket system the Canister IDs of the Comment Fetch and Like Fetch, so in the Root Post we also need to record and save the Comment Fetch and Like Fetch: // Persistently save the principal id of the commentFetch canister
stable var commentFetchCanister = _commentFetchCanister; // Externally query the currently saved commentFetch canister id public query func getCommentFetchCanister(): async Principal { commentFetchCanister
}; // Authorize specific caller to update the saved commentFetch canister id
public shared({caller}) func updateCommentFetchCanister**( newCommentFetchCanister: Principal ): async () { commentFetchCanister := newCommentFetchCanister; }; Now the principal ID of the likeFetch canister can be persistently saved, flexibly updated via the update function, and externally queried. // Persistently save the principal id of the likeFetch canister
stable var likeFetchCanister = _likeFetchCanister; // Externally query the currently saved likeFetch canister id
public query func getLikeFetchCanister(): async Principal { likeFetchCanister
}; // Authorize specific caller to update the saved likeFetch canister id public shared({caller}) func updateLikeFetchCanister**( newLikeFetchCanister: Principal
): async () { likeFetchCanister := newLikeFetchCanister;
}; Finally there are two system functions preupgrade() and postupgrade(), used to save and reset the entries of buckets, availableBuckets and unavailableBuckets before and after the Canister upgrade. system func preupgrade() { bucketsEntries := Iter.toArray(buckets.entries()); availableBucketsEntries := Iter.toArray(availableBuckets.entries()); unavailableBucketsEntries := Iter.toArray(unavailableBuckets.entries());
}; system func postupgrade() { bucketsEntries := []; availableBucketsEntries := []; unavailableBucketsEntries := [];
