public shared({caller}) func createFeedCanister(): async ?Principal { // Check the caller's identity assert(_getUserFeedCanister(caller) == null); // Allocate 2 trillion cycles for each new canister Cycles.add(2 * T_CYCLES); // Call the `Feed.Feed` method to create the user's feed canister let feedCanister = await Feed.Feed( caller, rootPostCanister, userCanister, postFetchCanister, commentFetchCanister, likeFetchCanister ); // Get the ID of the canister and store it in the mapping TrieMap let feedCanisterId = Principal.fromActor(feedCanister); userFeedCanisterMap.put(caller, feedCanisterId); // Call the ic method to update the settings of the canister, authorizing the Root Canister and the user as controllers await ic.update_settings({ canister_id = feedCanisterId; settings = { freezing_threshold = null; controllers = ?[Principal.fromActor(this), feedCanisterId]; memory_allocation = null; compute_allocation = null; } }); // Update the information in fetch; also update the mapping in Post/Comment/Like Fetch Canisters for this user ignore updateFetchUserToFeed((caller, feedCanisterId)); // Return the ID of the newly created feed canister ?feedCanisterId
