}; These several functions are used to query the mapping relationships of user Feed Canisters: Different interfaces for user queries, getting all mappings, getting totals, etc., can be used to query the mapping relationships of user Feed Canisters for reading the current internal state of the Feed system. // Receives a user Principal as a parameter
public query func getUserFeedCanister(user: Principal): async ?Principal { // Calls a private function, returns the Feed Canister Principal corresponding to the user _getUserFeedCanister(user)
}; // return [(user, feedCanister)]
public query func getAllUserFeedCanister(): async [(Principal, Principal)] { // Converts the internal userFeedCanisterMap to an array // Returns an array of all user-to-Feed Canister mapping relationships Iter.toArray(userFeedCanisterMap.entries())
}; // Total number of Canisters created
public query func getTotalUserFeedCanisterNumber(): async Nat { // Returns the size of userFeedCanisterMap, i.e., the total number of Feed Canisters userFeedCanisterMap.size()
}; // Internal private method, queries the user's Feed
private func _getUserFeedCanister(user: Principal): ?Principal { // Queries userFeedCanisterMap switch(userFeedCanisterMap.get(user)) { case(null) { return null;}; // Returns the corresponding Feed Canister Id based on the given user Principal case(?canister) { return ?canister;}; };
}; When creating a Bucket, we also need to specify the Canister IDs for Post Fetch, Comment Fetch, and Like Fetch in the Bucket system. Therefore, in the Root Post, we also need to record and save Post Fetch, Comment Fetch, and Like Fetch: stable var postFetchCanister = _postFetchCanister; public query func getPostFetchCanister(): async Principal { postFetchCanister }; public shared({caller}) func updatePostFetchCanister( newPostFetchCanister: Principal
): async () { postFetchCanister := newPostFetchCanister;
}; // CommentFetchCanister stable var commentFetchCanister = _commentFetchCanister; public query func getCommentFetchCanister(): async Principal { commentFetchCanister }; public shared({caller}) func updateCommentFetchCanister( newCommentFetchCanister: Principal
): async () { commentFetchCanister := commentFetchCanister;
}; // LikeFetchCanister stable var likeFetchCanister = _likeFetchCanister; public query func getLikeFetchCanister(): async Principal { likeFetchCanister }; public shared({caller}) func updateLikeFetchCanister( newLikeFetchCanister: Principal
): async () { likeFetchCanister := newLikeFetchCanister;
}; system func preupgrade() { userFeedCanisterMapEntries := Iter.toArray(userFeedCanisterMap.entries());
}; system func postupgrade() { userFeedCanisterMapEntries := [];
}; Finally, there are two system functions preupgrade() and postupgrade(), used to save data before and after Canister upgrades.

