The database.mo file is responsible for storing data inside the user's Feed Canister. First, define the storage structure for post indexes and mapping relationships, as well as related query interfaces. postIndex is used to generate a unique ID for posts; postMap stores post data. getPostIndexEntries and getPostMapEntries are used to query the index range and mapping relationships of posts. // Define some type aliases related to posts
type Post = Types.Post;
type PostImmutable = Types.PostImmutable;
type Comment = Types.Comment;
type NewComment = Types.NewComment;
type UserId = Types.UserId;
type Time = Types.Time;
type Like = Types.Like;
type NewLike = Types.NewLike;
type Repost = Types.Repost;
type NewRepost = Types.NewRepost; // An incrementing post index value
var postIndex: Nat = postIndexEntries;
// A mapping table from post index to post, implemented using TrieMap
let postMap = TrieMap.fromEntries<Nat, Post>(postMapEntries.vals(), Nat.equal, Hash.hash); // postIndex -> Post // Returns the current maximum post index value
public func getPostIndexEntries(): Nat { postIndex }; // Returns an array of all mapping relationships in postMap
public func getPostMapEntries(): [(Nat, Post)] { Iter.toArray(postMap.entries()) }; // Generates a unique ID for posts, in the format: bucket#user#index
private func _getPostId(bucket: Principal, user: Principal, index: Nat): Text { Principal.toText(bucket) # "#" # Principal.toText(user) # "#" # Nat.toText(index)
}; Posting The logic of posting in the Feed Canister: Implement the construction of post information and store it in the post mapping table. Also returns an immutable post object to prevent posts from being modified. The incrementing postIndex ensures that each post has a globally unique ID. Post data is stored in TrieMap for efficient querying. // Posting
public func createPost(user: UserId, feedCanister: Principal, content: Text, time: Time, bucket: Principal): PostImmutable { let post: Post = { // Generate a unique ID for the post postId = _getPostId(bucket, user, postIndex); // Construct a Post record, including post content, user information, time, etc. feedCanister = feedCanister; index = postIndex; user = user; content = content; var repost = []; var like = []; var comment = []; createdAt = time; }; // Put this Post record into postMap postMap.put(postIndex, post); // Increment postIndex postIndex += 1; // Return PostImmutable Utils._convertPostToImmutable(post)
}; Provides basic interfaces for external post queries. Implements functionality to get the total number of posts and retrieve individual posts based on ID. // Get the total number of posts
public func getPostNumber(): Nat { // Directly call postMap's size() postMap.size()
}; // Get a single post based on ID
public func getPost(postId: Text): ?PostImmutable { // Receive the post ID as a parameter, first call checkPostId() to validate the ID format let (bucket, user, index) = utils.checkPostId(postId); // Retrieve the post record post from postMap based on the index switch(postMap.get(index)) { // If it doesn't exist, return null case(null) { return null; }; // If it exists, return the post case(?post) { return ?{ postId = post.postId; feedCanister = post.feedCanister; index = post.index; user = post.user; repost = post.repost; content = post.content; like = post.like; comment = post.comment; createdAt = post.createdAt; } }; };
}; Commenting Returns a tuple containing the Bucket and the updated array of post comments. Therefore, this function checks if the post exists, adds a new comment if it does, and returns a tuple containing the bucket where the post is located and the updated post information. The main logic is to check parameters, retrieve the original post information, update the post comments, and return the updated post comments. // Commenting
public func createComment(commentUser: UserId, postId: Text, content: Text, createdAt: Time): ?(Principal, NewComment) { // Check if the post ID is valid and return the bucket, user, and index in the array where the post is located let (bucket, user, index) = utils.checkPostId(postId); // Get the post post to be commented on, return null if it does not exist switch(postMap.get(index)) { case(null) { return null;}; case(?post) { // If the post exists, add the new comment to the post's comment array // The comment content includes user ID, comment content, and time post.comment := Array.append(post.comment, [{ user = commentUser; // User ID of the commenter content = content; // Comment content createdAt = createdAt; // Comment time }]); ?(bucket, post.comment) }; };
}; Liking Actually, it's similar to the comment function mentioned earlier. It also uses postMap.get(index). // Liking
public func createLike(likeUser: UserId, postId: Text, createdAt: Time): ?(Principal, NewLike) { let (bucket, user, index) = utils.checkPostId(postId); switch(postMap.get(index)) { case(null) { return null; }; case(?post) { for(like in post.like.vals()) { // Already liked if(like.user == likeUser) { return null;}; }; post.like := Array.append<Like>(post.like, [{ user = likeUser; createdAt = createdAt; }]); ?(bucket, post.like) }; }
}; Reposting Similar to the above. // Reposting
public func createRepost(repostUser: UserId, postId: Text, createdAt: Time): ?(Principal, NewRepost) { let (bucket, user, index) = utils.checkPostId(postId); switch(postMap.get(index)) { case(null) { return null; }; case(?post) { for(repost in post.repost.vals()) { // Already reposted if(repost.user == repostUser) { return null;}; }; post.repost := Array.append<Repost>(post.repost, [{ user = repostUser; createdAt = createdAt; }]); ?(bucket, post.repost) }; }
}; Querying All Posts The function getAllPost retrieves all posts (Post) from a mapping (postMap), converts them into an immutable form (PostImmutable), and sorts them by creation time. Finally, it returns the sorted array of posts. TrieMap.map: Uses TrieMap.map to map each key-value pair in postMap, converting it to an immutable type PostImmutable. This mapping is done using the Nat type for keys, handling key equality and hashing with Nat.equal and Hash.hash. TrieMap.map<Nat, Post, PostImmutable>( postMap, Nat.equal, Hash.hash, func (k: Nat, v1: Post): PostImmutable { Utils._convertPostToImmutable(v1) }
) .vals(): Retrieves all values of the mapping, returning an array containing all converted PostImmutable values. TrieMap.map<Nat, Post, PostImmutable>(...).vals() Iter.sort: Sorts the array of values by comparing posts based on their creation time (createdAt). Uses Order.Order to specify the sorting order, where #less indicates ascending, #greater indicates descending, and #equal indicates equality. Iter.sort<PostImmutable>( TrieMap.map<Nat, Post, PostImmutable>(...).vals(), func (x: PostImmutable, y: PostImmutable): Order.Order { if(x.createdAt > y.createdAt) return #less else if(x.createdAt < y.createdAt) return #greater else return #equal }
) Iter.toArray: Converts the sorted array of posts into a Motoko array, ultimately serving as the return value of the function. Iter.toArray(...) The purpose of the entire function is to retrieve all posts from the mapping, convert them into an immutable form, and sort them by creation time before returning the sorted array of posts. public func getAllPost(): [PostImmutable] { Iter.toArray( Iter.sort<PostImmutable>( TrieMap.map<Nat, Post, PostImmutable>( postMap, Nat.equal, Hash.hash, func (k: Nat, v1: Post): PostImmutable { Utils._convertPostToImmutable(v1) } ).vals(), func (x: PostImmutable, y: PostImmutable): Order.Order { if(x.createdAt > y.createdAt) return #less else if(x.createdAt < y.createdAt) return #greater else return #equal })) }; }; FeedDirectory Class Without further ado, let's dive into the code: public class FeedDirectory( feedMapEntries: [(Text, PostImmutable)]
) { type PostImmutable = Types.PostImmutable; // Using the TrieMap type to create a mapping, where the key is of type Text and the value is of type PostImmutable // Used for storing post data let feedMap = TrieMap.fromEntries<Text, PostImmutable>(feedMapEntries.vals(), Text.equal, Text.hash); // Returns an array containing all mapping entries public func getFeedMapEntries(): [(Text, PostImmutable)] { Iter.toArray(feedMap.entries()) }; // Adds a post to the mapping, with the key being the postId of the post public func storeFeed(post: PostImmutable) { feedMap.put(post.postId, post); }; // Bulk adds all posts in the post array to the mapping public func batchStoreFeed(postArray: [PostImmutable]) { for(_post in postArray.vals()) { feedMap.put(_post.postId, _post); }; }; // Returns the number of posts stored in the mapping public func getFeedNumber(): Nat { feedMap.size() }; // Returns the post corresponding to the given postId // Returns null if the post does not exist public func getFeed(postId: Text): ?PostImmutable { switch(feedMap.get(postId)) { case(null) { return null; }; case(?_feed) { return ?_feed; }; }; }; // Returns the latest n posts, sorted by creation time public func getLatestFeed(n: Nat): [PostImmutable] { let feedArray = Iter.toArray( Iter.sort<PostImmutable>( feedMap.vals(), func (x: PostImmutable, y: PostImmutable): Order.Order { if(x.createdAt > y.createdAt) return #less else if(x.createdAt < y.createdAt) return #greater else return #equal })); // If the requested quantity exceeds the actual number of posts, return all posts if(n <= feedArray.size()) { Array.subArray(feedArray, 0, n) } else { Array.subArray(feedArray, 0, feedArray.size()) } }; }; database.mo complete file: import Array "mo:base/Array";
import HashMap "mo:base/HashMap";
import Iter "mo:base/Iter";
import Option "mo:base/Option";
