import utils "../utils";
import Text "mo:base/Text";
import Order "mo:base/Order";
import Utils "../utils"; module { type Post = Types.Post; public class PostDirectory( postIndexEntries: Nat, postMapEntries: [(Nat, Post)] ) { type Post = Types.Post; type PostImmutable = Types.PostImmutable; type Comment = Types.Comment; type NewComment = Types.NewComment; type UserId = Types.UserId; type Time = Types.Time; type Like = Types.Like; type NewLike = Types.NewLike; type Repost = Types.Repost; type NewRepost = Types.NewRepost; var postIndex: Nat = postIndexEntries; let postMap = TrieMap.fromEntries<Nat, Post>(postMapEntries.vals(), Nat.equal, Hash.hash); // postIndex -> Post public func getPostIndexEntries(): Nat { postIndex }; public func getPostMapEntries(): [(Nat, Post)] { Iter.toArray(postMap.entries()) }; private func _getPostId(bucket: Principal, user: Principal, index: Nat): Text { Principal.toText(bucket) # "#" # Principal.toText(user) # "#" # Nat.toText(index) }; public func createPost(user: UserId, feedCanister: Principal, content: Text, time: Time, bucket: Principal): PostImmutable { let post: Post = { postId = _getPostId(bucket, user, postIndex); feedCanister = feedCanister; index = postIndex; user = user; content = content; var repost = []; var like = []; var comment = []; createdAt = time; }; postMap.put(postIndex, post); postIndex += 1; Utils._convertPostToImmutable(post) }; public func getPostNumber(): Nat { postMap.size() }; public func getPost(postId: Text): ?PostImmutable { let (bucket, user, index) = utils.checkPostId(postId); switch(postMap.get(index)) { case(null) { return null; }; case(?post) { return ?{ postId = post.postId; feedCanister = post.feedCanister; index = post.index; user = post.user; repost = post.repost; content = post.content; like = post.like; comment = post.comment; createdAt = post.createdAt; } }; }; }; public func createComment(commentUser: UserId, postId: Text, content: Text, createdAt: Time): ?(Principal, NewComment) { let (bucket, user, index) = utils.checkPostId(postId); switch(postMap.get(index)) { case(null