Owner In the Feed Canister, it is necessary to store information about who the owner is and allow the owner to transfer their control later. stable var owner = _owner; // Query owner, allowing contract users to asynchronously retrieve the current owner
// Since it is a query function, it does not modify the contract state, so it can be called by any user without consensus
public query func getOwner(): async Principal { owner }; // Update owner
public shared({caller}) func updateOwner(newOwner: Principal): async () { assert(caller == owner); owner := newOwner;
}; public query({caller}) func whoami(): async Principal { caller }; Fetch Canister Similarly, the Feed Canister needs to keep records of various Fetch Canisters. stable var postFetchCanister = _postFetchCanister; public query func getPostFetchCanister(): async Principal { postFetchCanister }; public shared({caller}) func updatePostFetchCanister( newPostFetchCanister: Principal
): async () { postFetchCanister := newPostFetchCanister;
}; CommentFetchCanister: stable var commentFetchCanister = _commentFetchCanister; public query func getCommentFetchCanister(): async Principal { commentFetchCanister }; public shared({caller}) func updateCommentFetchCanister( newCommentFetchCanister: Principal
): async () { commentFetchCanister := commentFetchCanister;
}; LikeFetchCanister: stable var likeFetchCanister = _likeFetchCanister; public query func getLikeFetchCanister(): async Principal { likeFetchCanister }; public shared({caller}) func updateLikeFetchCanister( newLikeFetchCanister: Principal
): async () { likeFetchCanister := newLikeFetchCanister;
}; Followers The Feed Canister also maintains a list of followers. When a user posts, the Feed Canister sends the post ID and followers to the Fetch Canister, indicating which followers should be notified. In urgent situations, posts can be sent directly to followers in a peer-to-peer manner, also useful for peer-to-peer messaging. stable var followers: [Principal] = []; // Receive updates from the user canister
public shared({caller}) func updateFollowers(newFollowers: [Principal]): async () { followers := newFollowers;
}; public query func getFollowers(): async [Principal] { followers
}; Bucket type RootPostActor = Types.RootPostActor;
stable var bucket: ?Principal = null;
stable let rootPostActor: RootPostActor = actor(Principal.toText(rootPostCanister)); // Update the current bucket canister to be used for storing the feed
public shared func checkAvailableBucket(): async Bool { switch((await rootPostActor.getAvailableBucket())) { case(null) { return false; }; case(?_bucket) { bucket := ?_bucket; return true; }; };
}; public query func getBucket(): async ?Principal { bucket }; Post Next are the functionalities related to posts. type Time = Types.Time;
type UserId = Types.UserId;
type BucketActor = Types.BucketActor;
type PostFetchActor = Types.PostFetchActor;
type Post = Types.Post; stable var postIndexEntries: Nat = 0;
stable var postMapEntries: [(Nat, Post)] = [];
let postDirectory: Database.PostDirectory = Database.PostDirectory(postIndexEntries, postMapEntries); // Query the number of posts a user has made (total count)
public query func getPostNumber(): async Nat { postDirectory.getPostNumber()
}; // Query a specific post made by the user based on the post ID
public query func getPost(postId: Text): async ?PostImmutable { postDirectory.getPost(postId)
}; // Query all posts
public query func getAllPost(): async [PostImmutable] { postDirectory.getAllPost()
}; Core logic for users to create posts. public shared({caller}) func createPost(title: Text, content: Text): async Text { // Check if it is called by the owner of the feed to ensure the existence of the bucket (where posts are stored) assert(caller == owner and bucket != null); let _bucket = Option.unwrap(bucket); // Create a new post let post: PostImmutable = postDirectory.createPost(caller, Principal.fromActor(this), content, Time.now(), _bucket); // Send the post content to the public area of the Bucket let bucketActor: BucketActor = actor(Principal.toText(_bucket)); assert(await bucketActor.storeFeed(post)); // Notify PostFetch that there is a new post let postFetchActor: PostFetchActor = actor(Principal.toText(postFetchCanister)); await postFetchActor.receiveNotify(followers, post.postId); post.postId
}; Creating reposts. public shared({caller}) func createRepost(postId: Text): async Bool { switch(postDirectory.createRepost(caller, postId, Time.now())) { case(null) { return false; }; case(?(_bucket, _newRepost)) { // Notify the bucket to update repost information let bucketActor: BucketActor = actor(Principal.toText(_bucket)); assert(await bucketActor.updatePostRepost(postId, _newRepost)); // Get the followers of the one who reposted let userActor: UserActor = actor(Principal.toText(userCanister)); let _repostUserFollowers = await userActor.getFollowersList(caller); // Notify PostFetch let postFetchActor: PostFetchActor = actor(Principal.toText(postFetchCanister)); await postFetchActor.receiveNotify(_repostUserFollowers, postId); return true; }; };
}; Comments and likes. We use the postDirectory object to create comments or likes. // Shared function, caller information needs to be provided
public shared({caller}) func createComment(postId: Text, content: Text): async Bool { // Match the return value of postDirectory.createComment switch(postDirectory.createComment(caller, postId, content, Time.now())) { // Creation failed case(null) { return false; }; // If it returns a tuple containing _bucket and _newComment, it means the comment was created successfully, and the following actions are performed case(?(_bucket, _newComment)) { // Notify the corresponding bucket to update comments let bucketActor: BucketActor = actor(Principal.toText(_bucket)); // The assert keyword is used to ensure the success of the update operation assert(await bucketActor.updatePostComment(postId, _newComment)); return true; }; };
}; public shared({caller}) func createLike(postId: Text): async Bool { switch(postDirectory.createLike(caller, postId, Time.now())) { case(null) { return false; }; case(?(_bucket, _newLike)) { // Notify the bucket to update like information let bucketActor: BucketActor = actor(Principal.toText(_bucket)); assert(await bucketActor.updatePostLike(postId, _newLike)); return true; }; };
}; Feed Define some type aliases and variables. type PostImmutable = Types.PostImmutable;
type FeedActor = Types.FeedActor;
type UserActor = Types.UserActor;
type CommentFetchActor = Types.CommentFetchActor;
type LikeFetchActor = Types.LikeFetchActor; stable var feedMapEntries: [(Text, PostImmutable)] = [];
let feedDirectory = Database.FeedDirectory(feedMapEntries); In addition to publishing posts, comments, and likes, the Feed also needs to receive notifications from other Fetch Canisters to update the internal feed. public shared({caller}) func receiveFeed(postId: Text): async Bool { let (_bucket, _, _) = Utils.checkPostId(postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(postId))) { case(null) { return false; }; case(?_post) { feedDirectory.storeFeed(_post); return true; }; };
}; Sometimes the Feed needs to receive a lot of posts at once, so we also need a function for batch receiving posts. It receives an array containing multiple post IDs, retrieves post information from the corresponding Bucket for each post ID, and stores it in the feedDirectory if the post exists. public shared({caller}) func batchReceiveFeed(postIdArray: [Text]): async () { for(_postId in postIdArray.vals()) { let (_bucket, _, _) = Utils.checkPostId(_postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(_postId))) { case(null) { }; case(?_post) { feedDirectory.storeFeed(_post); }; }; };
}; Receive comments and notify the followers of the user based on the repost information of the post. If the post does not exist, the function returns false. public shared({caller}) func receiveComment(postId: Text): async Bool { let (_bucket, _, _) = Utils.checkPostId(postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(postId))) { case(null) { return false; }; case(?_post) { feedDirectory.storeFeed(_post); if(Utils._isRepostUser(_post, owner)) { // If the user is the repost user of this post, continue pushing to their followers let userActor: UserActor = actor(Principal.toText(userCanister)); let repostUserFollowers = await userActor.getFollowersList(owner); let commentFetchActor: CommentFetchActor = actor(Principal.toText(commentFetchCanister)); await commentFetchActor.receiveRepostUserNotify(repostUserFollowers, postId); }; return true; }; };
}; Batch receive comments. public shared({caller}) func batchReceiveComment(postIdArray: [Text]): async () { for(_postId in postIdArray.vals()) { let (_bucket, _, _) = Utils.checkPostId(_postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(_postId))) { case(null) { }; case(?_post) { feedDirectory.storeFeed(_post); if(Utils._isRepostUser(_post, owner)) { // If the user is the repost user of this post, continue pushing to their followers let userActor: UserActor = actor(Principal.toText(userCanister)); let repostUserFollowers = await userActor.getFollowersList(owner); let commentFetchActor: CommentFetchActor = actor(Principal.toText(commentFetchCanister)); await commentFetchActor.receiveRepostUserNotify(repostUserFollowers, _postId); }; }; }; };
}; Receive likes. public shared({caller}) func receiveLike(postId: Text): async Bool { let (_bucket, _, _) = Utils.checkPostId(postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(postId))) { case(null) { return false; }; case(?_post) { feedDirectory.storeFeed(_post); if(Utils._isRepostUser(_post, owner)) { // If the user is the repost user of this post, continue pushing to their followers let userActor: UserActor = actor(Principal.toText(userCanister)); let repostUserFollowers = await userActor.getFollowersList(owner); let likeFetchActor: LikeFetchActor = actor(Principal.toText(likeFetchCanister)); await likeFetchActor.receiveRepostUserNotify(repostUserFollowers, postId); }; return true; }; };
}; Batch receive likes. public shared({caller}) func batchReceiveLike(postIdArray: [Text]): async () { for(_postId in postIdArray.vals()) { let (_bucket, _, _) = Utils.checkPostId(_postId); let bucketActor: BucketActor = actor(Principal.toText(_bucket)); switch((await bucketActor.getPost(_postId))) { case(null) {}; case(?_post) { feedDirectory.storeFeed(_post); if(Utils._isRepostUser(_post, owner)) { // If the user is the repost user of this post, continue pushing to their followers let userActor: UserActor = actor(Principal.toText(userCanister)); let repostUserFollowers = await userActor.getFollowersList(owner); let likeFetchActor: LikeFetchActor = actor(Principal.toText(likeFetchCanister)); await likeFetchActor.receiveRepostUserNotify(repostUserFollowers, _postId); }; }; }; };
}; Finally, there are some query functions. public query func getFeedNumber(): async Nat { feedDirectory.getFeedNumber()
}; public query func getFeed(postId: Text): async ?PostImmutable { feedDirectory.getFeed(postId)
}; public query func getLatestFeed(n: Nat): async [PostImmutable] { feedDirectory.getLatestFeed(n)
